import React from "react";
import s from './Header.module.css';

function Header(){
    return(
<div className={s.header}>
    <header>
        <img src="https://images5.alphacoders.com/587/thumb-1920-587597.jpg" alt="Kaneki-kun"/>
    </header>
</div>)
    }
export default Header;
